  \"2013-03-15T14:36:57.264958\",\n\t\"name\": \"transroad-rtlogpts2002\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The RTLOGPTS2002 data layer consists of
  VTrans Route Log intersection and LRS calibration points. RTLOGPTS points were derived
  from two primary sources; RDSCPTS2000 (existing calibration point coverage) and
  a VTran's Route Log intersection database (event table). The route log event table
  was converted into a point coverage using dynamic segmentation (applied against
  RDSLRS2000). Mileages were derived from VTrans Route Logs and other sources (refer
  to MILE_SRC). The points were then QA/QCed against 5K orthophotos. The RTLOGPTS2002
  data layer was developed by VCGI under contract with VTrans.\",\n\t\"license_title\":
